                    ></input>
                    <div className="post-numbergroup2">-</div>
                    <input
                      type="number"
                      id="nameproduct"
                      pattern="[0-9]{1,}"
                      className="postnumber2"
                      onChange={(e) => Setsearchend(parseInt(e.target.value))}
                      value={searchend}
                    ></input>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <Chatbot />
    </div>
  );
};

export default Post;
